import './footer.css';
import React from 'react';
import { MDBCol, MDBContainer, MDBRow, MDBFooter } from "mdbreact";

const Footer = () => {
    return (
      <MDBFooter color="blue" className="font-small pt-4 mt-4">
        <MDBContainer fluid className="text-center text-md-left">
          <MDBRow>

            <h5 className="title">🌱 ¡Construyamos una red de huertos! 🌾🍃</h5>
            <p>
              Ingresa al formulario y mapea tu huerto.
            </p>

          </MDBRow>
        </MDBContainer>
        <div className="footer-copyright text-center py-3">
          <MDBContainer fluid>
            Elaborado por <a href="https://www.instagram.com/huertolaluchita"> La Luchita </a>
          </MDBContainer>
        </div>
      </MDBFooter>

    );
  }

export default Footer;
